var title_f33_22_34145="Overdrive pacing";
var content_f33_22_34145=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F61185&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F61185&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Effect of overdrive pacing on spontaneous automaticity of Purkinje fiber",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 306px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The more rapid discharge from the sinus node produces overdrive suppression of Purkinje fiber automaticity. Microelectrode recording from a Purkinje fiber at baseline shows a maximum diastolic potential of -77 mV. During overdrive pacing, the membrane becomes hyperpolarizaed and maximum diastolic potential increases to -85 mV, resulting in part from the accumulation of sodium ions, activation of the sodium-potassium pump, and an increased influx of potassium as sodium is extruded. After the cessation of overdrive pacing, the onset of the next spontaneous action potential is delayed since the slow of phase 4 diastolic depolarization is reduced and the more negative diastolic potential increases in the time required to reach threshold.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
