var title_f33_22_34146="LV pressure diastolic dysfunct";
var content_f33_22_34146=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F79441&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F79441&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Left ventricular pressure tracing in diastolic dysfunction",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 431px; height: 228px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The left ventricular pressure is initially recorded with a scale of 0 to 200 mmHg and then at 0 to 40 mmHg. Although the systolic and diastolic pressures are normal, the pressure waveform in diastole is abnormal; there is a continuing decline of pressure over the mid-diastolic period (as opposed to the gradual rise seen in normal subjects) with the pressure nadir occurring midway through the diastolic period and there is a prominent \"a\" wave generated by left atrial contraction.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from Kern MJ. ACC Current Journal Review, 1997.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
