var title_f33_22_34154="Flecainide and exercise-induced ventricular arrhythmias";
var content_f33_22_34154=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F50360&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F50360&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 628px\">",
"   <div class=\"ttl\">",
"    Flecainide treatment prevents exercise induced ventricular arrhythmia in two subjects with CPVT refractory to conventional drug therapy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 608px; height: 577px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (Panels A-D) Effect of flecainide treatment in a 12-year-old boy (subject 1) with a",
"    <em>",
"     CASQ2",
"    </em>",
"    mutation (Panels A and B) and in a 36-year-old female (subject 2) with an",
"    <em>",
"     RYR2",
"    </em>",
"    mutation (Panels C and D). Top of each panel, representative ECGs recorded during maximum stress; bottom of each panel, heart rate and rate of ventricular extrasystoles during an exercise test. Blue area indicates arrhythmia burden. Exercise protocol and ventricular extrasystole analysis are as previously described. Drug therapy during each exercise test: metroprolol 100 mg d",
"    <sup>",
"     -1",
"    </sup>",
"    plus verapamil 120 mg d",
"    <sup>",
"     -1",
"    </sup>",
"    (Panel A), metroprolol 100 mg d",
"    <sup>",
"     -1",
"    </sup>",
"    plus flecainide 150 mg d",
"    <sup>",
"     -1",
"    </sup>",
"    for 7 weeks (Panel B), bisoprolol 5 mg d",
"    <sup>",
"     -1",
"    </sup>",
"    plus verapamil 240 mg d",
"    <sup>",
"     -1",
"    </sup>",
"    (Panel C) or flecainide 150 mg d",
"    <sup>",
"     -1",
"    </sup>",
"    for 8 weeks (Panel D). Experiments involving human subjects were reviewed and approved by the University of Amsterdam Academic Medical Center Institutional Medical Ethical Review Board. Both human subjects (or their parents) provided informed consent.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted by permission from: Macmillan Publishers Ltd. Watanabe, H, Chopra, N, Laver, D, et al. Flecainide prevents catecholamineric polymorphic ventricular tachycardia in mice and humans. Nat Med. 2009; 15:380. Copyright &copy;2009.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
